import React from "react";

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faBars} from "@fortawesome/free-solid-svg-icons";
import {faCopy} from "@fortawesome/free-regular-svg-icons";
import {faMagnifyingGlass} from "@fortawesome/free-solid-svg-icons";

import "./SideBar.css";

function SideBar() {
    return (<div className="left-bar">
        <div className="left-bar-item" style={{height: "35px"}}>
            <div className="left-bar-icon"
                 style={{fontSize: "1.1rem", transform: "scaleX(1.3) translateY(0.1rem) scaleY(0.9)"}}>
                <FontAwesomeIcon icon={faBars}/>
            </div>
        </div>
        <div className="left-bar-item">
            <div className="left-bar-icon">
                <FontAwesomeIcon icon={faCopy}/>
            </div>
        </div>
        <div className="left-bar-item">
            <div className="left-bar-icon" style={{fontSize: "1.4rem"}}>
                <FontAwesomeIcon icon={faMagnifyingGlass}/>
            </div>
        </div>
    </div>);
}

export default SideBar;
